import React from 'react'
import ExpenseItem from "./components/ExpenseItem";
import Card from './Card';

function expenses () {
    let expense=[
        {id:"e1", title:"Car Insurance",date:new Date(2021,2,28),price:294.67
      },
      {id:"e2",title:"Toilet Paper",date:new Date(2021,8,13),price:94.12
    },
    {id:"e3",title:"New Tv",date:new Date(2021,3,11),price:799.49
    },
    {id:"e4",title:"New Desk(Wooden)",date:new Date(2021,6,11),price:450
    }
    
      ]
      return (
    
       <Card
       className='expenses'>
     <ExpenseItem  title={expense[0].title} 
        date={expense[0].date} price={expense[0].price} />
        <ExpenseItem   title={expense[1].title} 
        date={expense[1].date} price={expense[1].price} /> 
         <ExpenseItem  title={expense[2].title} 
        date={expense[2].date} price={expense[2].price} />
             <ExpenseItem  title={expense[3].title} 
        date={expense[3].date} price={expense[3 ].price} />
    </Card>
      );
    }
    
    export default  expenses
